import { useTheme } from '@mui/material/styles';

const RecipeIdeas: React.FC = () => {
  const [bodyType, setBodyType] = useState<'ectomorph' | 'mesomorph' | 'endomorph'>('ectomorph');
  const navigate = useNavigate();
  const theme = useTheme(); // Ajout de l'utilisation du thème Material-UI

  const handleHomeClick = () => {
    navigate('/');
  };

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#000', 
      color: '#fff', 
      display: 'flex', 
      flexDirection: 'column',
      justifyContent: 'flex-start',
      alignItems: 'center', 
      padding: '0',
    }}>
      <AppBar position="fixed" sx={{ backgroundColor: '#FF9800', width: '100%' }}>
        <Toolbar>
          <Button 
            variant="contained" 
            onClick={handleHomeClick} 
            sx={{ 
              backgroundColor: '#FF9800', 
              color: '#fff', 
              '&:hover': { backgroundColor: '#e68900' } 
            }}
          >
            Home
          </Button>
        </Toolbar>
      </AppBar>

      <Toolbar />

      <Container 
        sx={{
          width: { xs: '90%', sm: '80%', md: '60%' },
          padding: { xs: '50px 20px', sm: '100px' },
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          color: '#fff',
          backgroundColor: 'rgba(255, 255, 255, 0.1)',
          borderRadius: '10px',
          marginTop: '20px',
        }}
      >
        <Typography 
          variant="h4" 
          gutterBottom 
          sx={{
            fontSize: theme.breakpoints.down('sm') ? '1.5rem' : '2rem', // Utilisation de breakpoints pour fontSize
          }}
        >
          Recipe Ideas for {bodyType.charAt(0).toUpperCase() + bodyType.slice(1)}
        </Typography>

        <FormControl fullWidth sx={{ marginBottom: '20px' }}>
          <InputLabel sx={{ color: '#fff' }}>Body Type</InputLabel>
          <Select
            value={bodyType}
            onChange={(e) => setBodyType(e.target.value as 'ectomorph' | 'mesomorph' | 'endomorph')}
            label="Body Type"
            sx={{ backgroundColor: 'rgba(192, 192, 192, 0.8)', borderRadius: '5px' }}
          >
            <MenuItem value="ectomorph">Ectomorph</MenuItem>
            <MenuItem value="mesomorph">Mesomorph</MenuItem>
            <MenuItem value="endomorph">Endomorph</MenuItem>
          </Select>
        </FormControl>

        <Grid container spacing={3}>
          {recipes[bodyType].map((recipe, index) => (
            <Grid item xs={12} sm={6} key={index}>
              <Card sx={{ backgroundColor: '#333', marginBottom: { xs: '20px', sm: '0' } }}>
                <CardContent>
                  <Typography 
                    variant="h6" 
                    sx={{ 
                      color: '#fff', 
                      fontSize: theme.breakpoints.down('sm') ? '1.2rem' : '1.5rem' 
                    }}
                  >
                    {recipe.name}
                  </Typography>
                  <Typography sx={{ color: '#ccc', fontSize: theme.breakpoints.down('sm') ? '0.9rem' : '1rem' }}>
                    {recipe.description}
                  </Typography>
                  <Typography sx={{ color: '#fff', marginTop: '10px' }}>Ingredients:</Typography>
                  <ul>
                    {recipe.ingredients.map((ingredient, i) => (
                      <li 
                        key={i} 
                        style={{ color: '#ccc', fontSize: theme.breakpoints.down('sm') ? '0.8rem' : '1rem' }}
                      >
                        {ingredient}
                      </li>
                    ))}
                  </ul>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

export default RecipeIdeas;
